n able to make Hamler a consistent deep threat, but his ability to take short passes and quickly head up field should be helpful against a Miami defense that is unlikely to let Denver's quarterback, whether it's Drew Lock (ribs) or Brett Rypien, sit too long in the pocket.\",\"title\":\"Leads team in targets\"},{\"timeEpochMilli\":\"1605760447000\",\"contents\":\"Denver Broncos rookie wide receiver K.J. Hamler has seen 10 targets in back-to-back weeks and caught four passes for 50 yards in the Week 10 loss to the division-rival Raiders. The 20 targets in the last two weeks shows that Hamler has earned a more prominent role alongside fellow rookie Jerry Jeudy and Tim Patrick. The 21-year-old has a bright future and could be very successful out of the slot in this offense, but he's not quite a weekly flex consideration in fantasy leagues with Jeudy, ...\",\"url\":\"https://www.rotoballer.com/player-news/k-j-hamler-becoming-more-of-a-factor/805783\",\"title\":\"K.J. Hamler Becoming More Of A Factor\"}],\"isRookie\":true,\"nameFirst\":\"K.J.\",\"nameLast\":\"Hamler\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"DEN\",\"location\":\"Denver\",\"name\":\"Broncos\"},\"externalIds\":[{\"id\":\"89338a12-65a8-4670-ac99-97281732ff79\"}],\"positionEligibility\":[\"WR\"]},\"requestedGames\":[{\"game\":{\"id\":6413,\"away\":{\"abbreviation\":\"MIA\",\"location\":\"Miami\",\"name\":\"Dolphins\"},\"home\":{\"abbreviation\":\"DEN\",\"location\":\"Denver\",\"name\":\"Broncos\"},\"startTimeEpochMilli\":\"1606079100000\",\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true}},\"stats\":[{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"}},{\"category\":{\"id\":26,\"abbreviation\":\"Fum\",\"nameSingular\":\"Fumble\",\"namePlural\":\"Fumbles\",\"lowerIs